from typing import List
from collections import deque


class Solution:
    def minAvailableDuration(self, slots1: List[List[int]], slots2: List[List[int]], duration: int) -> List[int]:

        slots1 = [[a, b] for a, b in slots1 if b - a >= duration]
        slots1.sort()
        slots2 = [[a, b] for a, b in slots2 if b - a >= duration]
        slots2.sort()
        dq = deque()
        dq.append((0, 0))
        la = len(slots1)
        lb = len(slots2)
        while dq:
            p, q = dq.popleft()
            if p >= la or q >= lb:
                return []
            a, b = slots1[p]
            c, d = slots2[q]

            if b < c:
                dq.append((p + 1, q))
                continue
            if a > d:
                dq.append((p, q+1))
                continue


            md = max(a, c)

            if min(b, d) - md >= duration:
                return [md, md + duration]

            if la >= lb:
                dq.append((p + 1, q))
                dq.append((p, q + 1))
            else:
                dq.append((p, q + 1))
                dq.append((p + 1, q))

